import React, { Component } from 'react';

class App extends Component {

  render() {
    return (
      <div className="">
        <header className="">
          <h1>Weather API Racer</h1>
        </header>

        <div>
          <label htmlFor="zip-code">Zip Code</label>
          <input name="zip-code" type="text" placeholder="Enter a zip code" />
        </div>

      </div>
    );
  }
}

export default App;
